import React, { Component } from "react";
import TextField from '@mui/material/TextField';
import './Signup.css';
import InputAdornment from '@mui/material/InputAdornment';
import AccountCircle from '@mui/icons-material/AccountCircle';
import AlternateEmailIcon from '@mui/icons-material/AlternateEmail';
import LocalPhoneIcon from '@mui/icons-material/LocalPhone';
import InsertPhotoIcon from '@mui/icons-material/InsertPhoto';


class Signup extends React.Component{
	render(){
		return(
			<div className="signup">
				<h1>Sign Up</h1>
				<div className="textfield">
					<TextField 
						fullWidth 
						id="outlined-basic" 
						label="Last Name" 
						InputProps={{
							startAdornment: (
								<InputAdornment position="start">
									<AccountCircle />
								</InputAdornment>
							),
						}} 
						variant="outlined" />
				</div>
				<div className="textfield">
					<TextField 
						fullWidth 
						id="outlined-basic" 
						label="First Name" 
						InputProps={{
							startAdornment: (
								<InputAdornment position="start">
									<AccountCircle />
								</InputAdornment>
							),
						}} 
						variant="outlined" />
				</div>
				<div className="textfield">
					<TextField 
						fullWidth 
						id="outlined-basic" 
						label="E-mail" 
						InputProps={{
							startAdornment: (
								<InputAdornment position="start">
									<AlternateEmailIcon />
								</InputAdornment>
							),
						}} 
						variant="outlined" />
				</div>
				<div className="textfield">
					<TextField 
						fullWidth 
						id="outlined-basic" 
						label="Phone Number" 
						InputProps={{
							startAdornment: (
								<InputAdornment position="start">
									<LocalPhoneIcon />
								</InputAdornment>
							),
						}} 
						variant="outlined" />
				</div>
				<div className="textfield">
					<TextField 
						fullWidth 
						id="outlined-basic" 
						label="Picture" 
						InputProps={{
							startAdornment: (
								<InputAdornment position="start">
									<LocalPhoneIcon />
								</InputAdornment>
							),
						}} 
						variant="outlined" />
				</div>
				<div className="textfield"><TextField fullWidth id="outlined-basic" label="Password" variant="outlined" /></div>
				<div className="textfield"><TextField fullWidth id="outlined-basic" label="Confirm Password" variant="outlined" /></div>
			</div>
		)
	}
}

export default Signup;
